pragma solidity 0.4.23;

// Safe Math library that automatically checks for overflows and underflows
library SafeMath {
    // Safe multiplication
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a * b;
        require(a == 0 || c / a == b);
        return c;
    }
    // Safe subtraction
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a);
        return a - b;
    }
    // Safe addition
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c>=a && c>=b);
        return c;
    }
}

/// @title Owned contract
/// @author InnoChain
contract Owned {
    address public owner;

    modifier onlyOwner {
        require(msg.sender == owner, "msg.sender isn't owner");
        _;
    }
    constructor() public {
        owner = msg.sender;
    }
}

/// @title ERC20 Token contract
/// @author InnoChain
/// @notice Basic ERC20 functionality
contract Token is Owned {
    using SafeMath for uint256;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);

    // This creates a mapping with all balances
    mapping (address => uint256) public balanceOf;
    // Another mapping with spending allowances
    mapping (address => mapping (address => uint256)) public allowance;
    // The total supply of the token
    uint256 public totalSupply;
    // variables for wallet integration
    string public name;
    string public symbol;
    uint8 public decimals;

    constructor(uint256 _totalSupply) public {
        name = "Odeon Mining Token";
        symbol = "OMT";
        decimals = 18;
        totalSupply = _totalSupply;
        balanceOf[owner] = totalSupply;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != 0x0);
        require(_to != address(this));
        balanceOf[msg.sender] = balanceOf[msg.sender].sub(_value);
        balanceOf[_to] = balanceOf[_to].add(_value);
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_to != 0x0);
        require(_to != address(this));
        balanceOf[_to] = balanceOf[_to].add(_value);
        balanceOf[_from] = balanceOf[_from].sub(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function increaseApproval(address _spender, uint _addedValue) public returns (bool success) {
        allowance[msg.sender][_spender] = allowance[msg.sender][_spender].add(_addedValue);
        emit Approval(msg.sender, _spender, allowance[msg.sender][_spender]);
        return true;
    }

    function decreaseApproval(address _spender, uint _subtractedValue) public returns (bool success) {
        uint256 oldValue = allowance[msg.sender][_spender];
        if (_subtractedValue > oldValue) {
            allowance[msg.sender][_spender] = 0;
        } else {
            allowance[msg.sender][_spender] = oldValue.sub(_subtractedValue);
        }
        emit Approval(msg.sender, _spender, allowance[msg.sender][_spender]);
        return true;
    }
}

contract ODEON is Token {

    mapping(address => uint256) public balance;
    mapping(address => uint256) private priceIndex;
    // mapping(address => uint256) dayCount;
    mapping(address => uint256) timer;

    uint256[] pricePerDay;
    mapping(uint256 => uint256) priceTimeStamp;

    uint256 period;

    constructor(uint256 _price, uint256 _period) public {
        setPrice(_price);
        period = _period;
    }

    function updateBalance(address _client) public returns (bool) {
        uint256 currentIndex = priceIndex[_client];
        // if current index is not set, inits the timer and the priceIndex
        if (currentIndex == 0) {
            priceIndex[_client] = pricePerDay.length;
            timer[_client] = now;
            return true;
        }
        // updates average balance once a day at most
        // using memory variables to save gas
        uint256 tempTimer = timer[_client];
        if (now.sub(tempTimer) >= period) {
            uint256 tokenBalance = balanceOf[_client];
            uint256 tempBalance = balance[_client];
            // skips if account is at newest price, if not updates balances for previous prices with the priceTimeStamp variable
            for (currentIndex; currentIndex < pricePerDay.length; currentIndex++) {
                uint256 tempDay = priceTimeStamp[currentIndex.add(1)].sub(tempTimer)/(1 days);
                tempTimer = tempTimer.add(tempDay.mul(1 days));
                tempBalance = tempBalance.add(tempDay.mul(tokenBalance.mul(pricePerDay[currentIndex.sub(1)])));
            }

            uint256 day = now.sub(tempTimer)/(1 days);
            timer[_client] = tempTimer.add(day.mul(1 days));
            // updates balance according to latest price
            balance[_client] = tempBalance.add(day.mul(tokenBalance.mul(pricePerDay[currentIndex.sub(1)])));
        }
        return true;
    }

    function returnBalance(address _client) public view returns (uint256) {
        uint256 currentIndex = priceIndex[_client];
        // if current index is not set, inits the timer and the priceIndex
        if (currentIndex == 0) {
            return 0;
        }
        // updates average balance once a day at most
        // using memory variables to save gas
        uint256 tempTimer = timer[_client];
        uint256 tokenBalance = balanceOf[_client];
        if (now.sub(tempTimer) >= period) {
            uint256 tempBalance = balance[_client];
            // skips if account is at newest price, if not updates balances for previous prices with the priceTimeStamp variable
            for (currentIndex; currentIndex < pricePerDay.length; currentIndex++) {
                uint256 tempDay = priceTimeStamp[currentIndex.add(1)].sub(tempTimer)/(1 days);
                tempTimer = tempTimer.add(tempDay.mul(1 days));
                tempBalance = tempBalance.add(tempDay.mul(tokenBalance.mul(pricePerDay[currentIndex.sub(1)])));
            }

            uint256 day = now.sub(tempTimer)/(1 days);
            // updates balance according to latest price
            tokenBalance = tempBalance.add(day.mul(tokenBalance.mul(pricePerDay[currentIndex.sub(1)])));
        }
        return tokenBalance;

    }

    function withdraw() public {
        balance[msg.sender] = 0;
    }

    function setPrice(uint256 _value) public onlyOwner {
        pricePerDay.push(_value);
        priceTimeStamp[pricePerDay.length] = now;
    }

    function updateLatestPrice(uint256 _value) public onlyOwner {
        pricePerDay[pricePerDay.length.sub(1)] = _value;
    }

    function setPeriod(uint256 _period) public onlyOwner {
        period = _period;
    }

    // Overwrite transfer and transferFrom
    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != 0x0 && _to != address(this));
        updateBalance(msg.sender);
        updateBalance(_to);
        balanceOf[msg.sender] = balanceOf[msg.sender].sub(_value);
        balanceOf[_to] = balanceOf[_to].add(_value);
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_to != 0x0 && _to != address(this));
        updateBalance(_from);
        updateBalance(_to);
        balanceOf[_to] = balanceOf[_to].add(_value);
        balanceOf[_from] = balanceOf[_from].sub(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        emit Transfer(_from, _to, _value);
        return true;
    }
}

contract OdeonToken is ODEON {
    constructor(uint256 _totalSupply, uint256 _price, uint256 _period) public Token(_totalSupply) ODEON(_price, _period) {}
}

